import React, { useState } from "react";


function Square(prop){
  return (
    <button onClick={prop.onSquareClick} className="square">{prop.index}</button>
  );
}

function Board(prop){
  // const [table, setTable] = useState(Array(9).fill(null));
  // const [nxtSymbol, setNextSymbol] = useState(true);

  // function handleClick(index){
  //   if(findWinner(table) || table[index] !== null){
  //     return;
  //   }

  //   const newTable = [...table];
  //   if(nxtSymbol){
  //     newTable[index] = "X";
  //   }
  //   else{
  //     newTable[index] = "O";
  //   }
  //   setNextSymbol(!nxtSymbol)
  //   setTable(newTable);    
  // }


  const isWinner = findWinner(prop.table);
  let status;
  if(isWinner){
    let sym = prop.nxtSymbol ? "O":"X";
    status = "Winner: " + sym;
  }
  else{
    let sym = prop.nxtSymbol ? "X":"O";
    status = "Next Player: " + sym;
  }

  return (
  <>
    <div className="board-row">
      <p className="status">{status}</p>
      <Square index = {prop.table[0]} onSquareClick = {() => {prop.handleClick(0)}} />
      <Square index = {prop.table[1]} onSquareClick = {() => {prop.handleClick(1)}} />
      <Square index = {prop.table[2]} onSquareClick = {() => {prop.handleClick(2)}} />
    </div>

    <div className="board-row">
      <Square index = {prop.table[3]} onSquareClick = {() => {prop.handleClick(3)}} />
      <Square index = {prop.table[4]} onSquareClick = {() => {prop.handleClick(4)}} />
      <Square index = {prop.table[5]} onSquareClick = {() => {prop.handleClick(5)}} />
    </div>

    <div className="board-row">
      <Square index = {prop.table[6]} onSquareClick = {() => {prop.handleClick(6)}} />
      <Square index = {prop.table[7]} onSquareClick = {() => {prop.handleClick(7)}} />
      <Square index = {prop.table[8]} onSquareClick = {() => {prop.handleClick(8)}} />
    </div>
  </>
  ) 
}

export default function Game(){

  const [nxtSymbol, setNextSymbol] = useState(true);
  const [gameState, setGameState] = useState([Array(10).fill(null)]);
  const currTable = gameState[gameState.length -1];

  function gameClick(index){
    if(findWinner(currTable) || currTable[index] !== null){
      return;
    }

    const newTable = [...currTable];
    if(nxtSymbol){
      newTable[index] = "X";
    }
    else{
      newTable[index] = "O"; 
    }
    let newGameState = [...gameState];
    newGameState.push(newTable);
    setGameState(newGameState);    
    setNextSymbol(!nxtSymbol)
  }
  console.log(gameState)
  return (
    <div className="game">
      <div className="game-board">
        <Board handleClick = {gameClick} table = {currTable} nxtSymbol = {nxtSymbol}/>
      </div>
      <div className="game-info">
        <ol>{/* TODO */}</ol>
      </div>
    </div>
  )
}

function findWinner(newArray){
  for(let i=0; i<3; i++){
    if(newArray[3*i] === newArray[3*i + 1] && newArray[3*i] === newArray[3*i + 2] && newArray[3*i] !== null){
      return true;
    }
    else if(newArray[i] === newArray[i+3] && newArray[i] === newArray[i+6] && newArray[i] !== null){
      return true;
    }
    else if(newArray[0] === newArray[4] && newArray[0] === newArray[8] && newArray[0] !== null){
      return true;
    }
    else if(newArray[2] === newArray[4] && newArray[4] === newArray[6] && newArray[4] !== null){
      return true;
    }
  }
  return false;
}
